import React from 'react';
import './SubmitButton.css';

const SubmitButton = props => {
  return(
    <div 
      className="SubmitButton-wrapper"
      onClick={props.handleClick}
      > 
      <span>Submit</span>
    </div>
  );
};

export default SubmitButton;
